package com.ufgov.zc.server.zc.service.impl;import java.util.List;import com.ufgov.zc.common.zc.model.EmExpertTypeJoin;import com.ufgov.zc.server.zc.dao.IExpertTypeJoinDao;import com.ufgov.zc.server.zc.service.IExpertTypeJoinService;public class ExpertTypeJoinService implements IExpertTypeJoinService {  IExpertTypeJoinDao expertTypeJoinDao = null;  public IExpertTypeJoinDao getExpertTypeJoinDao() {    return expertTypeJoinDao;  }  public void setExpertTypeJoinDao(IExpertTypeJoinDao expertTypeJoinDao) {    this.expertTypeJoinDao = expertTypeJoinDao;  }  public List insertListExpertTypeJoin(List emExpertTypeJoinlist) {    try {      for (int i = 0; i < emExpertTypeJoinlist.size(); i++) {        EmExpertTypeJoin joinPo = (EmExpertTypeJoin) emExpertTypeJoinlist.get(i);        this.expertTypeJoinDao.insertExpertTypeJoin(joinPo);      }    } catch (Exception e) {      e.printStackTrace();    }    return null;  }}